    const [value, setValue] = useState(html);

    return (
        <KotlinPlayground mode="kotlin" targetPlatform='js' onChange={(code) => {handleHtmlChange(); setValue(code)}}>
        <pre>
          <code>

                <textarea value={value}></textarea>

          </code>
        </pre>
      </KotlinPlayground>
    )
}

export default Test;
